node.text:
I remember almost three years ago we went to Palais Longchamp at Marseille for our final year study trip. It was definitely one of the most memorable experiences I ever had. As one of the notable gardens of France, it houses Beaux-arts museum and natural history museum. I was mesmerised at this beautiful palace and its architecture. It was like visiting a fantasy place. The structure, the stairs, the facade and the landscape were a masterpiece!

